    public function uninstall()
    {
        Configuration::deleteByName('FACEBOOKFEED_LIVE_MODE');

        $sql = array();

        $sql[] = 'DROP TABLE IF EXISTS `' . _DB_PREFIX_ . 'google_product_category`;';
        $sql[] = 'DROP TABLE IF EXISTS `' . _DB_PREFIX_ . 'google_category`;';

        foreach ($sql as $query) {
            if (Db::getInstance()->execute($query) == false) {
                return false;
            }
        }

        return parent::uninstall();
    }

    public function getCategories($treeCategories, $listCategories, $parentId, $parentName)
    {

        foreach ($listCategories as $category) {
            if (!isset($treeCategories[$category['id']])) {
                $googleCategoryName = '';
                $googleCategoryId = $this->getGoogleCategorysByCategoryId($category['id']);
                if ($googleCategoryId) {
                    $googleCategoryName = $this->getGoogleCategoryById($googleCategoryId['google_category_id']);
                }

                if ($parentId == 0) {
                    $treeCategories[] = array(
                        'categoryId' => $category['id'],
                        'name' => $category['name'],
                        'googleCategoryId' => ($googleCategoryId) ? $googleCategoryId["google_main_category_id"] : '',
                        'googleCategoryName' => ($googleCategoryName) ? $googleCategoryName["google_category_name"] : ''
                    );
                } else {
                    $treeCategories[] = array(
                        'categoryId' => $category['id'],
                        'name' => $parentName . ' > ' .$category['name'],
                        'googleCategoryId' => ($googleCategoryId) ? $googleCategoryId["google_main_category_id"] : '',
                        'googleCategoryName' => ($googleCategoryName) ? $googleCategoryName["google_category_name"] : ''
                    );
                }

                if (isset($category['children']) && !empty($category['children'])) {
                    $treeCategories = $this
                        ->getCategories($treeCategories, $category['children'], $category['id'], $category['name']);
                }
            }
        }

        return $treeCategories;
    }

    public function getContent()
    {
        $this->context->controller->addJqueryUI('jquery-ui');
        $rootCategories = Category::getRootCategory($this->context->cookie->id_lang);
        $tree = $rootCategories->recurseLiteCategTree();
        $categories = array();
        $googlemaincategories = array();

        $currencies = Currency::getCurrencies();
        $languages = Language::getLanguages();
        $attributes = AttributeGroup::getAttributesGroups($this->context->cookie->id_lang);

        $options = array();
        $options['currentCurrency'] = Configuration::get('currency_facebook_feed') ?: '';
        $options['currentLanguage'] = Configuration::get('language_facebook_feed') ?: '';
        $options['currentColor'] = Configuration::get('color_facebook_feed') ?: '';
        $options['currentSize'] = Configuration::get('size_facebook_feed') ?: '';
        $options['currentMaterial'] = Configuration::get('material_facebook_feed') ?: '';
        $options['currentPattern'] = Configuration::get('pattern_facebook_feed') ?: '';
        $options['siteDescription'] = Configuration::get('site_description_facebook_feed') ?: '';

        if (isset($tree['children']) && !empty($tree['children'])) {
            $categories = $this->getCategories(array(), $tree['children'], 0, '');
        }

        $responses = $this->getGoogleMainCategory();

        foreach ($responses as $response) {
            $googlemaincategories[] = array(
                'google_category_id'    => $response['google_category_id'],
                'google_category_name'  => $response['google_category_name']
            );
        }

        $this->context->controller->addJS($this->_path. 'views/js/riot_compiler.min.js');
        $this->context->smarty->assign('module_dir', $this->_path);
        $this->context->smarty->assign('categories', $categories);
        $this->context->smarty->assign('googlemaincategories', $googlemaincategories);
        $this->context->smarty->assign('currencies', $currencies);
        $this->context->smarty->assign('languages', $languages);
        $this->context->smarty->assign('attributes', $attributes);
        $this->context->smarty->assign('options', $options);

        $output = $this->context->smarty->fetch($this->local_path.'views/templates/admin/configure.tpl');
        return $output  . $this->display($this->local_path, 'views/templates/admin/prestui/ps-tags.tpl');
    }

    public function getGoogleCategoryByName($categoryName)
    {
        $response = Db::getInstance()
            ->executes("SELECT * FROM " . _DB_PREFIX_ . "google_product_category WHERE google_category_name = '" .
                pSQL($categoryName) . "'");
        if (is_array($response)) {
            return array_shift($response);
        }
    }

    public function updateGoogleCategories($data)
    {
        Db::getInstance()
            ->execute("INSERT INTO " . _DB_PREFIX_ . "google_product_category SET google_category_id = '" .
                (int)$data['google_category_id'] . "', google_category_name = '" .
                pSQL($data['google_category_name']) . "', google_category_parent = '" .
                (int)$data['google_category_parent'] . "'");
    }

    public function getGoogleCategorysByCategoryId($category_id)
    {
        $query = Db::getInstance()
            ->executes("SELECT * FROM " . _DB_PREFIX_ . "google_category WHERE category_id = '" .
                (int)$category_id . "'");

        if (count($query)) {
            return array_shift($query);
        }
        return '';
    }

    public function getGoogleMainCategory()
    {
        $query = Db::getInstance()
            ->executes("SELECT * FROM " . _DB_PREFIX_ . "google_product_category WHERE google_category_parent = 0 ");

        return $query;
    }

    public function getGoogleCategoryById($google_category_id)
    {
        $query = Db::getInstance()
            ->executes("SELECT * FROM " . _DB_PREFIX_ . "google_product_category WHERE google_category_id = '" .
                pSQL($google_category_id) . "'");


        if (count($query)) {
            return array_shift($query);
        }

        return '';
    }
